export const DUMMY_EXPENSES = [
  {
    id: "e1",
    title: "Headphones",
    amount: 1299.99,
    date: new Date(2022, 10, 14),
  },
  { id: "e2", title: "New TV", amount: 79999, date: new Date(2021, 2, 12) },
  {
    id: "e3",
    title: "Pizza Hut",
    amount: 569,
    date: new Date(2021, 2, 28),
  },
];
